INSERT INTO `blogs` (`id`, `blog_title`, `blog_category`, `blog_desc`, `media_type`, `featured_image`, `permalink`, `publish_date`, `publish_year`, `created_by`, `updated_by`, `created_at`, `updated_at`, `status`) VALUES
(1, 'AYA Bank Offering Apprenticeship Opportunity', 4, '&lt;p class=&quot;MsoNormal&quot;&gt;AYA Bank organized &amp;lsquo;National Apprenticeship Program&amp;rsquo; in partnership with the National Management Acdemy (NMA) to shape the future of students&amp;nbsp;with a wide range of opportunities to learn a specific skill in the financial services industry.&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot;&gt;AYA Bank, represented by Daw Khine Swe Thaw, Head of Organization Development and NMA, represented by U Han Htoo, Managing Director has officially signed a partnership on 15&lt;sup&gt;th&lt;/sup&gt;&amp;nbsp;May, 2023, launching exclusive &quot;National Apprenticeship Program.&quot;. This program offers aspiring young students and professionals a unique opportunity to work at AYA Bank while pursuing studies at NMA.&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot;&gt;Selected apprentices from top ten students will gain hands-on experience in the banking industry and enjoy full employment facilities provided by AYA Bank. NMA will support their education by covering tuition fees, ensuring a well-rounded learning experience. The program spans 2 years, preparing apprentices for the final year of their bachelor\'s program and equipping them with valuable skills for your future career.&lt;/p&gt;\n&lt;p class=&quot;MsoNormal&quot; align=&quot;justify&quot;&gt;This programme is designed to bring highly qualified and motivated students with diverse backgrounds into the organization and gain valuable experiences.&lt;/p&gt;', 2, 'blog_images/Thumbnail-Image.jpeg', 'AYA_Bank_Offering_Apprenticeship_Opportunity', '2023-05-15T17:41', '2023', 1, 1, '2023-06-13 11:12:12', '2023-06-20 10:29:23', 0),
(2, 'Pioneering Green Financing for Electric Vehicles', 4, '&lt;p&gt;AYA Bank has taken a significant step towards promoting sustainable transportation by partnering exclusively with Essential EV Authorized Distributor, a leading electric vehicle distributor. On 11&lt;sup&gt;th&lt;/sup&gt;&amp;nbsp;May, 2023, U Minn Wint Oo, Managing Director of AYA Bank, U Nay Lin Htut Chief Credit Officer of AYA Bank, and U Colin Magson, Director of Consumer Banking from AYA Bank proudly attended the signing ceremony which will enable accessible and eco-friendly mobility options for the community.&lt;/p&gt;\r\n&lt;p&gt;Key features of this initiative include:&lt;/p&gt;\r\n&lt;p style=&quot;margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;&quot;&gt;&lt;!-- [if !supportLists]--&gt;&lt;span style=&quot;font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;&quot;&gt;&lt;span style=&quot;mso-list: Ignore;&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7.0pt \'Times New Roman\';&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;mso-spacerun: yes;&quot;&gt;&amp;nbsp;&lt;/span&gt;AYA Green EV Financing: Offering attractive interest rates and flexible repayment options&lt;/p&gt;\r\n&lt;p style=&quot;margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;&quot;&gt;&lt;!-- [if !supportLists]--&gt;&lt;span style=&quot;font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;&quot;&gt;&lt;span style=&quot;mso-list: Ignore;&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7.0pt \'Times New Roman\';&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;mso-spacerun: yes;&quot;&gt;&amp;nbsp;&lt;/span&gt;AYA Sompo Insurance coverage&lt;/p&gt;\r\n&lt;p style=&quot;margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;&quot;&gt;&lt;!-- [if !supportLists]--&gt;&lt;span style=&quot;font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;&quot;&gt;&lt;span style=&quot;mso-list: Ignore;&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7.0pt \'Times New Roman\';&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;mso-spacerun: yes;&quot;&gt;&amp;nbsp;&lt;/span&gt;Hassle-free loan processing and quick approval&lt;/p&gt;\r\n&lt;p style=&quot;margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;&quot;&gt;&lt;!-- [if !supportLists]--&gt;&lt;span style=&quot;font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;&quot;&gt;&lt;span style=&quot;mso-list: Ignore;&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7.0pt \'Times New Roman\';&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;mso-spacerun: yes;&quot;&gt;&amp;nbsp;&lt;/span&gt;Dedicated customer support from our knowledgeable teams and dealers, and&lt;/p&gt;\r\n&lt;p style=&quot;margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;&quot;&gt;&lt;!-- [if !supportLists]--&gt;&lt;span style=&quot;font-family: Symbol; mso-fareast-font-family: Symbol; mso-bidi-font-family: Symbol;&quot;&gt;&lt;span style=&quot;mso-list: Ignore;&quot;&gt;&amp;middot;&lt;span style=&quot;font: 7.0pt \'Times New Roman\';&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;!--[endif]--&gt;&lt;span style=&quot;mso-spacerun: yes;&quot;&gt;&amp;nbsp;&lt;/span&gt;Collaborative partnerships with dealerships for a seamless buying experience.&lt;/p&gt;\r\n&lt;p style=&quot;margin-left: .5in; text-indent: -.25in; mso-list: l0 level1 lfo1;&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;At AYA Bank, we firmly believe in the power of green financing to drive positive change and contribute to a sustainable future. Our partnership with Essential EV Authorized Distributor allows us to provide specialized financing solutions tailored specifically for electric vehicles, aligning with our commitment to support environmentally responsible initiatives.&lt;/p&gt;\r\n&lt;p&gt;Electric vehicles play a crucial role in reducing carbon emissions, improving air quality, and combating climate change. By offering EV financing loans, we aim to make electric vehicles more affordable and accessible to a wider range of customers, accelerating the transition to a greener and cleaner transportation sector.&lt;/p&gt;\r\n&lt;p&gt;This collaboration demonstrates AYA Bank&amp;rsquo;s ongoing commitment to sustainability and innovation. By embracing green financing, we drive positive impact, support the growth of the electric vehicle market, and contribute to the overall well-being of our planet.&lt;/p&gt;', 2, 'blog_images/Thumbnail-photo.jpeg', 'Pioneering_Green_Financing_for_Electric_Vehicles', '2023-05-11T17:47', '2023', 1, 1, '2023-06-13 11:18:10', '2023-06-26 12:44:46', 0),
(3, 'AYA Bank Signing MOU with UMFCCI for MSME Development', 4, '&lt;p&gt;To jointly cooperate for development of MSMEs, a Memorandum of Understanding (MOU) Signing Ceremony between AYA Bank and The Union of Myanmar Federtion of Chamber of Commerce and Industry (UMFCCI) was held on February 2nd of 2023.&amp;nbsp;&lt;br&gt;The MOU was signed betwen U Minn Wint Oo, Managing Director of AYA Bank and Daw Khaing Khaing Nwe, General Secretary of UMFCCI. The objective is to smoothly operate SME Businesses and to support for revitalization of the state economy of Myanmar along with the development MSMEs.&amp;nbsp;&lt;br&gt;The MOU includes:&amp;nbsp;&lt;br&gt;&amp;bull; &amp;nbsp; &amp;nbsp;To cooperate in activites (to build and extend networks; to hold workhops and seminars; to circulate correct information in a timely manner) for the development of MSME.&amp;nbsp;&lt;br&gt;&amp;bull; &amp;nbsp; &amp;nbsp;To commence MSME business in accordance with the bilateral agreements and to cooperate in providing loans necessary for development.&lt;br&gt;&amp;bull; &amp;nbsp; &amp;nbsp;To support bringing about entrepreneurial businesspeople in Myanmar by effectively applying the business networks and communication channels for the development of MSME.&lt;br&gt;U Myint Zaw (Chief Executive Officer), U Min Wint Oo (Managing Diretor) , Daw Thazin Aung (Managing Director) from AYA Bank and Vice Chairpersons U Ye Min Aung, U Aye Htun, Dr. Win Sithu and U San Lin, General Secretary Daw Khaing Khaing New, Joint Generals Secretary U Kyaw De Wa, U Ye Myint Maung and Daw Thu Zar Win, Chief Executive Officer Dr. Zaw Htay from UMFCCI attended the MOU Signing Ceremony.&lt;/p&gt;', 2, 'blog_images/Thumbnail-photo.jpg', 'AYA_Bank_Signing_MOU_with_UMFCCI_for_MSME_Development', '2023-02-02T18:06', '2023', 1, 1, '2023-06-13 11:37:06', '2023-06-27 11:02:57', 1),
(4, 'Top Income Tax Payer', 4, '&lt;p&gt;On 10th August 2020, top ten companies which pay the highest income tax, commercial tax, and special commodity tax for the State in the Assessement year 2018-2019 was awarded a Certificate of Honor and AYA has been recognized as one of the top income taxpayers&amp;rsquo; companies in Myanmar. AYA is a member of AYA Fianncial Group and also Myanmar&amp;rsquo;s leading technology based bank providing financial services with along with AYA Trust (Financial Securities)and AYA SOMPO (Insurance).&lt;/p&gt;', 1, 'blog_images/Top-Income-Tax-Payer.jpg', 'Top_Income_Tax_Payer', '2020-08-10T09:12', '2020', 1, 1, '2023-06-14 02:43:11', '2023-07-20 21:58:51', 0),
(5, '2020 Best Bank for SMEs Award  from AsiaMoney', 4, '&lt;p&gt;It is our honor to announce that AYA Bank has again won the Best Bank for SMEs Award selected by Asismoney for the Year 2020. AYA Bank &amp;nbsp;stand as &amp;nbsp;the most technologically advanced Bank in Myanmar within a short time. It is recognized as the best Bank supporting SMEs businesses due to the fact that it has been providing banking services for the development of SME in various ways.&lt;br&gt;In cooperaton with international financial supporting organizations, AYA will expand to a variety of SMEs and will do the selection of potential business and provision of loans at its best.&lt;/p&gt;', 1, 'blog_images/2020-Best-Bank-for-SMEs-Award-from-AsiaMoney.jpg', '2020_Best_Bank_for_SMEs_Award__from_AsiaMoney', '2020-05-05T09:14', '2020', 1, 1, '2023-06-14 02:45:17', '2023-06-27 11:34:11', 0),
(6, 'MOU between Mandalay Smart Pay (MSP) and AYA Bank', 4, '&lt;p&gt;A seamless digital mobile application known as Mandalay Smart Pay (MSP) was introduced for the citizens of Mandalay to enjoy payment online such as MCDC bills and other partnered payment outlets. A signing Ceremony on financial partnership between Mandalay Smart Pay (MSP) and AYA Bank was conducted in Mandalay on the 14th of March 2020 at the Mandalay Convention Center. The signing ceremony was attended, and the partnership agreement was signed by the Mandalay Mayor Dr. Ye Lwin and AYA Bank Managing Director U Myint Zaw. Mandalay Smart Pay (MSP) and AYA Bank will collaborate on financial digital payments for the benefit of the citizens of Mandalay.&amp;nbsp;&lt;/p&gt;', 2, 'blog_images/MOU-between-Mandalay-Smart-Pay-(MSP)-and-AYA-Bank.png', 'MOU_between_Mandalay_Smart_Pay_and_AYA_Bank', '2020-03-14T09:18', '2020', 1, 1, '2023-06-14 02:49:23', '2023-06-27 11:35:42', 0),
(7, 'Completion of Basic Banking Operations Training No.(8)', 4, '&lt;p&gt;The Graduation Ceremony of the 108th Batch of the Basic Banking training was held at 2 pm at the AYA Bank Head office (ROWE) on the 11th March 2020. The ceremony was attended by the Head of Departments, the trainers, the trainees, and U Ko Ko Oo (Senior Chief Risk and Compliance Officer) of AYA Bank delivered the graduation speech.&amp;nbsp;&lt;br&gt;After that, the invited Head of Departments awarded the trainees with certificates of completion and the outstanding achievers in the course were awarded with recognition medals and souvenirs. The first prize was awarded to Daw Hnin Nwe Oo from Yangon, the second prize to Daw Eaindra Tun from Kaw Ka Yeik and the third prize to Daw Yamin Phyo from Tha Paung and U Zaw Myo Aung from Yangon. On behalf of all trainees, one of the trainees expressed their gratitude, took commemorative photos with the officials presents and ended the ceremony. In the course, fifty-five trainees who will be working in Yangon, Pinlon, Kaw Ka Yeik, Myawaddy and Tha Paung were given both classroom and practical training. The duration of the training was six weeks.&amp;nbsp;&lt;/p&gt;', 2, 'blog_images/Class-108-3.jpg', 'Completion_of_Basic_Banking_Operations_Training_No8', '2020-03-11T09:20', '2020', 1, 1, '2023-06-14 02:51:47', '2023-06-27 11:09:56', 0),
(8, 'The opening of the (261) branch of AYA Bank', 4, '&lt;p&gt;We are proud to announce that we have extended our services to the public by opening the 261st Branch Office in Kawkareik.U Ko Ko Oo, Senior Chief Risk and Compliance Officer of AYA Bank, Head Office and responsible personnels from Region, Zone and Branch of AYA Bank extended a warm welcome at the opening ceremony to all attendees from respective government authorities, partner banks, the community and the customers of AYA Bank.&amp;nbsp;&lt;/p&gt;', 2, 'blog_images/Branch-261-1.jpg', 'The_opening_of_the_261_branch_of_AYA_Bank', '2020-03-05T09:23', '2020', 1, 1, '2023-06-14 02:53:57', '2023-06-27 11:27:29', 0),
(9, 'AYA SOMPO General Insurance Awareness and Sale & Marketing Training', 4, '&lt;p&gt;Training on &amp;ldquo;AYA SOMPO General Insurance Awareness and Sales &amp;amp; Marketing&amp;rdquo; was conducted by the Bancassurance Department of AYA Bank, at Myint Tar Nyunt Training Center on the 8th of February. Total of 36 attendees of which were supervisors, Assistant Supervisors, Receptionist and Sales Staff from 10 branches from Yangon Division were invited to attend the training.&lt;/p&gt;', 2, 'blog_images/IMG_0419.jpg', 'AYA_SOMPO_General_Insurance_Awareness_and_Sale_Marketing_Training', '2020-02-08T09:28', '2020', 1, 1, '2023-06-14 02:58:50', '2023-06-27 11:28:51', 0),
(10, 'Achievement of Silver Award for Myanmar Employer Awards 2019', 4, '&lt;p class=&quot;MsoNormal&quot;&gt;Myanmar Employer Awards 2019 was held on December 7th 2019 at Novetel Hotel, Yangon. Out of Local&amp;nbsp;and international based business companies, AYA Bank, member of the AYA Financial Group, was&amp;nbsp;proudly&amp;nbsp;awarded with the Best Career Advancement Program-Silver Award and People&amp;rsquo;s Choice Award-Silver Award.&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;justify&quot;&gt;Among the awards received, we are&amp;nbsp;proud to have been chosen for the &amp;ldquo;Best Career Advancement Program -Silver Award&amp;rdquo; which is, identical with the Program of AYA Bank, that is, to promote the quality needs of employees with modernized improvement programs.&lt;/p&gt;\r\n&lt;p class=&quot;15&quot; align=&quot;justify&quot;&gt;In order to extend the best quality services to our customers, we believe that quality of employess must be fully endowed&amp;nbsp;and hence , we are conducting training and nurturing them.&amp;nbsp;In addition, We are again honored to be awarded with&amp;nbsp;the &amp;ldquo;People&amp;rsquo;s Choice Award&amp;nbsp;(Silver Award)&amp;rdquo; as it is chosen with majority votes&amp;nbsp;of the people. We will never stop striving to uphold our best of service to our loyal customers although we achieved these awards as these awards empowers our employees to move forward with our partners of AYA Bank.&lt;/p&gt;', 2, 'blog_images/M-1.jpg', 'Achievement_of_Silver_Award_for_Myanmar_Employer_Awards_2019', '2019-12-07T09:29', '2019', 1, 3, '2023-06-14 03:02:06', '2023-07-17 18:01:42', 0),
(12, 'Green Energy Exhibition Banking Partner', 4, '&lt;p&gt;AYA Bank is proud to be The Official Banking Partner of the Green Energy Exhibition, organized by the Mandalay UMFCCI (The Union of Myanmar Federation of Chambers of Commerce and Industry) on 10th and 11th June 2023. Our dedicated team of senior executives and officials from Yangon and Mandalay, led by U Myint Zaw (Chief Executive Officer) and U Minn Wint Oo (Managing Director of Retail Banking), attended the grand opening ceremony, demonstrating our commitment to sustainable development.&lt;br&gt;&amp;nbsp;&lt;br&gt;The AYA Financial Group takes collective strength in presenting the complete suite of financial services to our valued customers at the Green Energy Exhibition. This remarkable occasion highlights the seamless collaboration between AYA Bank, AYA Pay, and AYA Sompo Insurance, delivering a truly holistic experience for our customers.&lt;/p&gt;\r\n&lt;p&gt;In today&#039;s world, where reducing carbon footprint is crucial, AYA Bank recognizes the importance of promoting green energy solutions. We firmly believe that investing in renewable energy is not only environmentally responsible but also economically beneficial. By supporting initiatives like the green energy exhibition, we aim to create awareness and provide accessible options with renewable energy sources and solutions for individuals and businesses to reduce their carbon footprint.&lt;/p&gt;\r\n&lt;p&gt;At the exhibition, renowned brands such as Tesla, Prime, Soco, offering a range of electric vehicles (EVs). These vehicles can not only help lower carbon emissions but also provide significant savings on fuel costs. With prices starting as low as USD $8,400 and attractive financing options like AYA Auto Loan, transitioning to an electric vehicle has become more affordable and convenient than ever before.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;We are excited to showcase how charging your electronic vehicles can be hassle-free. Battery stations are available, offering battery packs that can power your EV for up to 100 miles. This means fewer visits to refuel, making your journey more efficient and reducing your carbon footprint.&lt;/p&gt;\r\n&lt;p&gt;Moreover, as a leader in sustainable finance, AYA Bank offers Green Financing options to support individuals and SMEs to large enterprises in their eco-friendly endeavors. Whether it is investing in solar powered homes, renewable energy projects, energy-efficient infrastructure, or sustainable businesses, we provide customized financial solutions to drive positive environmental impact.&lt;/p&gt;', 2, 'blog_images/Green-Energy-Exhibition-Banking-Partner.webp', 'Green_Energy_Exhibition_Banking_Partner', '2023-06-10T10:44', '2023', 1, 1, '2023-06-26 10:44:41', '2023-06-28 23:53:51', 0),
(13, 'Workshop for Certified Branch Managers Program', 4, '&lt;p&gt;On June 22, 2023, AYA Bank organized a workshop to launch the Certified Branch Managers Program, bringing together our 265 Branch Managers from across the nation. The workshop served as an insightful and productive session, with the aim of recapping our business direction, addressing market challenges and opportunities, and fostering continuous improvement. Our esteemed Founding Chairman, U Zaw Zaw, and Executive Chairman, Daw Khin Saw Oo, provided valuable guidance and inspired everyone to strive for excellence.&lt;/p&gt;\r\n&lt;p&gt;Under the leadership of our Chief Executive Officer, U Myint Zaw, the Executive Team facilitated engaging discussions on overcoming obstacles and charting a successful path forward. This forum acknowledged challenges while reinforcing our commitment to growth and achieving our goals.&lt;/p&gt;\r\n&lt;p&gt;AYA Bank has implemented a comprehensive certification process for branch managers, which includes evaluating factors such as online studies test scores, workshop performance assessments, and practical field evaluations. This certification program underscores our dedication to recognizing and enhancing the expertise and competence of our branch managers, ensuring a high standard of performance across our branch network.&lt;/p&gt;', 2, 'blog_images/Workshop-for-Certified-Branch-Managers-Program.webp', 'Workshop_for_Certified_Branch_Managers_Program', '2023-06-22T11:33', '2023', 1, 1, '2023-06-26 11:35:34', '2023-06-28 23:54:26', 0),
(14, 'AYA Bank PCL\'s Foreign Currency Online Trading', 4, '<p>AYA Bank PCL participated in the online trading platform where the Central Bank of Myanmar is planning to trade foreign currency between AD-licensed banks and customers. The amount of transactions and the foreign exchange rates per day are attached.&nbsp;</p>', 4, 'blog_images/AYA-Bank-PCLs-Foreign-Currency-Online-Trading.webp', 'AYA_Bank_PCL_Foreign_Currency_Online_Trading', '2023-06-27T10:09', '2023', 1, 2, '2023-06-28 16:09:36', '2023-08-16 20:46:00', 0),
(16, 'Ayeyarwady Bank (AYA) and Siam Commercial Bank PCL (SCB) sign Memorandum of Understanding (MOU) on Cross Border Payments and Fund Transfer Services', 4, '&lt;p&gt;Ayeyarwady Bank (AYA Bank), the second largest bank in Myanmar and Siam Commercial Bank (SCB), a leading bank in Thailand signed a Memorandum of Understanding (MOU) on collaboration in the development of cross border payments and fund transfer services between the two countries. The agreement is to explore and develop cross border payment for workers and for SMEs&amp;rsquo; cross border transaction in order to encourage the use of formal cross border channels through the banks. The banks also agreed to explore on the Thai Baht and Myanmar Kyat direct conversion to support and service Thai and Myanmar clients of the banks.&lt;/p&gt;', 2, 'blog_images/SCB-Bank-1.jpg', 'Siam_Commercial_Bank_PCL_and_AYA_Sign_MOU', '2020-01-08T14:10', '2020', 1, 1, '2023-07-03 20:12:51', '2023-07-03 20:18:52', 0),
(17, 'AYA Financial Groupâ€™s Family Celebrating 10th Kathina Civara Dana Ceremony', 4, '<p>The 10th Kathina Civara Dama Ceremony of AYA Financial Group family was held successfully in the morning of November 9th 2019, at the new Aung Mingalar Monastery at Kanna Road, Alone Township, Yangon.&nbsp;</p>\r\n<p>At the ceremony, AYA Financial Group Chairman U Zaw Zaw, and spouse Daw Htay Htay Khaing, the family members along with the generous and devoted Bank employees from various branches donated cash and kind inclusive of materials, and alms together with Kathina robes. The value of donation in-kind is (11,977,166 Kyats), in-cash is (18,446,550 kyats) and alms (5,189,500 kyats). The total donation values at (35,613,216 kyats).</p>', 2, 'blog_images/Kathain-2.jpg', 'AYA_Financial_Groupâ€™s_Family_Celebrating_10th_Kathina_Civara_Dana_Ceremony', '2019-11-09T14:30', '2019', 1, 1, '2023-07-03 20:32:45', '2023-07-03 20:32:45', 0),
(18, 'AYA Financial Groupâ€™s 10th Homage Ceremony', 4, '<p>The Ceremony of 10th End of Buddhist Lent Homage Ceremony was held at ROWE Building (AYA Bank Headquarters) at 8am on the 10th of October 2019. At the ceremony, Chairman U Zaw Zaw and employees paid their respect to seniors who are great in virtue, wisdom, knowledge, position and age. Seniors &ndash; Vice Chairman (1) Daw Khin Saw Oo, Vice Chairman (2) U Than Zaw &nbsp;and Independent Non- Executive Director Dr. Aung Tun Thet, &nbsp;gave blessings to all employees. Afterwards, the employees paid homage to Chairman U Zaw Zaw and all repected seniors and Chairman U Zaw Zaw return a word of appreciation and blessings.</p>', 2, 'blog_images/Thadingyut-1.jpg', 'AYA_Financial_Groupâ€™s_10th_Homage_Ceremony', '2019-10-10T14:38', '2019', 1, 1, '2023-07-03 20:39:42', '2023-07-03 20:39:42', 0),
(19, 'Asia Money 2019 Awards: Best Bank for SMEs & Best Bank for CSR: Asia Money 2019 Best Bank for SMEs', 4, '&lt;p&gt;AYA Bank In an emerging economy where an estimated 90 to 95 out of every 100 registered businesses are small and medium-sized enterprises (SMEs), Zaw Zaw&amp;rsquo;s Ayeyarwady Bank wins plaudits from its peers for its lively SME business. AYA&amp;rsquo;s tactic has been to partner with multilaterals, development finance institutions and aid agencies, providing a leg-up to Myanmar&amp;rsquo;s emerging small business community.&lt;/p&gt;\r\n&lt;p&gt;For example, AYA has teamed up with the state-backed German Investment Corporation (DEG-KfW), as well as the United States Development Credit Agency and Japan&amp;rsquo;s JICA to identify customers and provide loans with agency support. The French government&amp;rsquo;s development wing, AFD-Proparco, is also a partner, as is the Asian Development Bank.&lt;/p&gt;\r\n&lt;p&gt;Today, SMEs account for 16% of AYA&amp;rsquo;s total loan book, and the bank expects that level to double by 2022 as Myanmar moves closer to middle-income status.&lt;/p&gt;\r\n&lt;p&gt;Asia Money 2019 Best Bank for CSR:&lt;br&gt;AYA Bank The May tour by English football team Leeds United may not have won Leeds many friends outside Myanmar, its focus was all domestic. The tour was part of AYA&amp;rsquo;s wider corporate social responsibility efforts during a busy year when it built hospitals and schools and financed ambulances across the country.&lt;/p&gt;\r\n&lt;p&gt;Zaw Zaw&amp;rsquo;s AYA Bank claims to have committed $90 million in CSR efforts since it was founded in 2010. Beyond sorely needed infrastructure, staff are regularly encouraged to donate blood and plant trees. AYA also sponsors disaster management programmes for vulnerable rural areas in the Ayeyarwady (Irrawaddy) river delta region, and it provided financial support for relief camps for flood victims in four stricken townships after recent inundations.&lt;/p&gt;', 2, 'blog_images/Asia-Money-Award-Photo.jpg', 'Asia_Money_2019_Awards_Best_Bank_for_SMEs_Best_Bank_for_CSR_Asia_Money_2019_Best_Bank_for_SMEs', '2019-06-13T14:52', '2019', 1, 1, '2023-07-03 20:55:14', '2023-07-14 23:42:01', 0),
(21, 'First Bank in Myanmar for achieving EDGE Certificate for Gender Equality', 4, '&lt;p&gt;EDGE Certificate for Gender Equality Ayeyarwady Bank is now the first bank in Myanmar that awarded EDGE Certificate for Gender Equality in working environment. The object of attempting to achieve this global recognized certificate is to become a better workplace which is supporting every gender the same in single sectors of office atmosphere. We are proudly sharing this record that winning International Award &amp;ldquo;EDGE Certificate for Gender Equality&amp;rdquo; is representing AYA Bank as an environment fostering equal career opportunities for women and men in the workplace. EDGE is the world-leading global assessment methodology and business certification standard for gender equality that incorporates benchmarking, metrics and accountability and recognized the organization and its working environment as a place having Gender Equality and providing the same opportunities and supportive actions to every women and men from the same working atmosphere. EDGE Certification is currently co-operating together globally with over 200 organizations and 23 different working industries in 50 Countries.&lt;/p&gt;', 0, 'blog_images/Edge-Image-1.jpg', 'First_Bank_in_Myanmar_for_achieving_EDGE_Certificate_for_Gender_Equality', '2019-06-13T15:11', '2019', 1, 1, '2023-07-03 21:19:04', '2023-07-21 16:50:07', 0),
(22, 'Publication of Report on Myanmarâ€™s Business Transparency, 2019 Pwint Thit Sa', 4, '&lt;p&gt;Myanmar Center for Responsible Business (MRCB) published the Fifth Pwint Thit Sa Report/ Transparency in Myanmar Enterprises (TiME) on 30th April 2019. The assessment was a joint collaboration with Yever, the Business Consultancy Group, which provided their services free of charge and in good faith. In 2019 Pwint Thit Sa report, 248 Myanmar companies were assessed through online for their disclosure of information inclusive of, 5 public listed, 55 &amp;lsquo;public&amp;rsquo; companies, 160 privately-owned companies and including 28 significant state-owned economic enterprises (SOEs) for the first time. This makes 2019 Pywint Thit Sa Report the most ambitious public report on business transparency. The report aims to support the objectives of 2018 sustainable development of Myanmar and to successfully accomplish sustainable development goal (especially SDG 16). Method of survey of 2019 Pwit Thit Sa Report is same as 2018&amp;rsquo;s. Scores are given based on the information posted on the websites of the assessed companies. Corporate contents, corporate governance , sustainable managment and reporting are measured with ASEAN Corporate Governance Scorecard Criteria. MRCB and Yever have given more scores on performance of sustainable managment in 2019 Report. Details of 2019 Pwint Thit Sa can be available. AYA Bank proudly stands on the Top (10) list of the Companies with highest scores of 2019 Pwint Thit Sa Report.&lt;/p&gt;', 0, 'blog_images/Pwint-Thit-Sa-Image.jpg', 'Publication_of_Report_on_Myanmarâ€™s_Business_Transparency_2019_Pwint_Thit_Sa', '2019-05-15T15:21', '2019', 1, 3, '2023-07-03 21:22:31', '2023-07-24 17:36:42', 0),
(23, 'Memorandum of Understanding Signing Ceremony between AYA Bank and Smart Myanmar', 4, '<p>A Memorandum of Understanding signing ceremony between AYA Bank and Smart Myanmar (A Project implemented by German Organization &ldquo;Sequa&rdquo;) was held on 30th January 2019 at 9 am at AYA Bank Limited (Headquarters), Yangon, aiming to jointly analyze environmental support projects that can provide financial services, to initiate pilot projects and to encourage more environmental loans programs in the coming years.&nbsp;</p>\r\n<p>At the ceremony , U Myint Zaw, Managing Director of AYA Bank, delivered a welcoming speech in which &ldquo; We are excited to support Green Financing in which businesses can thrive to create a greener environment and also is a new objective for us&rdquo;. All invited dignitaries and distinguished guests attended the said ceremony. AYA Bank has been providing financing services such as AYA SME Loan and JICA Two Step Loan for SME Entrepreneurs.&nbsp;</p>\r\n<p>SME entrepreneurs can apply for AYA SME Loan with a loan tenure from 1 to 3 years with a maximum of &nbsp;500 million Kyat in order to expand business and operate business as usual. With collateral free CGI (Loan Guarantee) system, AYA SME Loan and JICA Two Step Loan can be applied and obained through a loan guarantee services from USAID for myanmar insurance and agricultural sectors.</p>\r\n<p>&nbsp;</p>', 2, 'blog_images/Smart-Myanmar-Image-2.jpg', 'Memorandum_of_Understanding_Signing_Ceremony_between_AYA_Bank_and_Smart_Myanmar', '2019-01-31T15:25', '2019', 1, 1, '2023-07-03 21:26:06', '2023-07-03 21:26:06', 0),
(24, 'â€˜AML-CFT Awareness 2022 High Level Seminarâ€™ by AYA Bank on Money Laundering and Financing of Terrorism', 4, '&lt;p&gt;On October 29th, 2022, Compliance Department of AYA Bank in collaboration with the Learning &amp;amp; Developement Department conducted AML-CFT Awareness 2022 High Level Seminar for the Bank&#039;s BOD members, Senior Management, HODs and Division Heads via online. Subject matter experts from the Central Bank of Myanmar, Financial Intelligence Unit (FIU) and the Bureau of Special Investigation (BSI) were invited for high level discussions.&lt;/p&gt;\r\n&lt;p style=&quot;text-align: left;&quot;&gt;At the opening speech, AYA Bank&#039;s Executive Chairperson Daw Khin Saw Oo said,&lt;br&gt;&amp;bull;Due to the challenges and risks encountered in the banking industry, the Bank must be able to manage risks effectively to improve&amp;nbsp; &amp;nbsp; &amp;nbsp;its business on one hand and achieve a sound &amp;amp; stable financial standing on the other hand.&amp;nbsp;&lt;br&gt;&amp;bull;In regard to internal control, it is important to hold seminars and workshops for Board Members, Senior Management and&amp;nbsp; &amp;nbsp; &amp;nbsp;Managers to improve their AML- CFT Awareness.&lt;br&gt;&amp;bull;This seminar is conducted to increase knowledge on AML-CFT and learn how to apply, so that the attendees are encouraged to&amp;nbsp; &amp;nbsp; &amp;nbsp;learn with respect and apply in practice&lt;/p&gt;\r\n&lt;p&gt;Next, U Aung Kyaw Than, Director of Monetary Policy Affairs and Financial Institutions Regulation Department, The Central Bank of Myanmar, gave a presentation on the topic of &amp;lsquo;The Role of Bank&#039;s Senior Management in AML/CFT Preventive Measures&amp;rsquo;. He shared knowledge on anti-money laundering and discussed on practices to be complied by the BOD and Senior Management, HOD.&lt;/p&gt;\r\n&lt;p&gt;U Zaw Moe, Director of Financial Institutions Supervision (FISD) Department, The Central Bank of Myanmar, discussed on risk management measurements practised by The Central Bank of Myanmar, rating scores obtained for offsite and onsite inspection of AML Risk and mitigation points.&lt;/p&gt;\r\n&lt;p&gt;Under the title of Financial Action Task Force-FATF and Myanmar &quot;Challenges and Opportunities&quot;, Colonel U Myint Soe from FIU spoke about the current situation in Myanmar, recommended actions to be taken and cooperation required from the banks. In addition, U Thurin Aung, the Deputy Director of BSI, gave a lecture on &amp;lsquo;Preventive Measures&amp;rsquo; and &amp;lsquo;Countering the Financing of Proliferation&amp;rsquo;.&lt;/p&gt;\r\n&lt;p&gt;In conclusion, U Than Zaw, the Vice Chairman of AYA Bank, Chairman of the Board Risk and Compliance Committee, expressed his gratitude on behalf of the Bank to the experts who gave lectures on the subject for the seminar today, and the seminar was adjourned.&lt;/p&gt;', 0, 'blog_images/AML_CFT_Awareness_2022_High_Level_Seminar_by_AYA_Bank_on_Money_Laundering_Financing_of_Terrorism.webp', 'AML_CFT_Awareness_2022_High_Level_Seminar_by_AYA_Bank_on_Money_Laundering_and_Financing_of_Terrorism', '2022-10-29T11:14', '2022', 1, 3, '2023-07-07 17:18:36', '2023-07-21 17:29:12', 0),
(25, 'Implementation of Anti-Money Laundering/Combating the Financing of Terrorism (AML/CFT) by AYA Bank', 4, '&lt;p&gt;AYA Bank has conducted regular sharing sessions on AML/CFT process for senior management and all levels of employees at the bank and established effective implementation continuously.&lt;/p&gt;\r\n&lt;p&gt;In addition, following are implemented by the concerned officials.&lt;br&gt;&amp;bull; Senior management of the Bank and relevant departments understand the of the importance of Anit-Money Laundering Aand Terrorist Financing (AML/CFT) and establish related policies, procedures and proceeding;&lt;br&gt;&amp;bull; The Bank&#039;s Board Risk and Compliance Committee holds monthly meetings and provides necessary guideline and recommendations;&lt;br&gt;&amp;bull; Focused inspection on anti-money laundering and anti-terrorist financing communications&lt;br&gt;&amp;bull; Ensure that employees are aware of and follow instructions on combating money laundering and terrorist financing;&lt;br&gt;&amp;bull; According to the process of the Financial Action Task Force (FATF), the Bank complies and implements under the guidelines of the AML/CFT National Strategic Area (3) Implementation Committee;&lt;br&gt;&amp;bull; Enhance the knowledge and understanding of the Bank&#039;s compliance officers to implement and comply with the instructions set by the Bank in accordance with the rules established by the Central Bank of Myanmar.&lt;/p&gt;\r\n&lt;p&gt;To improve understanding of the Bank&amp;rsquo;s employees on the risks of loss regarding AML/CFT and financing of proliferation, subject experts from the Financial Intelligence Unit and the Special Investigation Department were invited to hold seminars for the awareness raising program and workshops every year.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Board Risk &amp;amp; Compliance Committee Meeting (3/2022)&lt;/strong&gt;&lt;br&gt;The Board Risk &amp;amp; Compliance Committee meeting (3/2022) was held on 12th August, 2022 at Pathein Conference Room of AYA Bank Head Office. The Bank&#039;s Senior Management, Department Heads, Compliance Officers and Division Heads attended and participated in discussions on conerned sectors.&lt;br&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;Financial Crime Seminar 2022&lt;/strong&gt;&lt;br&gt;&amp;lsquo;The Financial Crime Seminar 2022&amp;rsquo; organized by The Association of Banks in Singapore, held on 7-8 July, 2022, was participated by members of AYA Bank&#039;s Senior Management; Compliance Officers from concerned departments and Risk Managers through Webex.&lt;br&gt;In the seminar, the following topics were discussed by subject-specific experts.&lt;br&gt;&amp;bull; Cryptocurrencies &amp;ndash; risks, regulations and practices&lt;br&gt;&amp;bull; Cryptocurrency investment scams and ransomware attacks&lt;br&gt;&amp;bull; Establisha defense mechanism against financial crimes by fostering an effective and sustainable culture&lt;br&gt;&amp;bull; Raising awareness and regulatory expectations in environmental crime&lt;br&gt;&amp;bull; Building and expanding efficiencies in data analytics&amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;AML/CFT Virtual Workshop 2022&lt;/strong&gt;&lt;br&gt;Enterprise Risk Management and Compliance (ERMC) Department explained Compliance Officers&#039; responsibilities at branches, things to do, how to get customer KYC, CDD execution time and information, reporting matters, record keeping and penalties.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;AML/CFT Awareness Seminar 2021&lt;/strong&gt;&lt;br&gt;An AML/CFT Awareness Seminar 2021 for the employees of AYA Bank, which is held regularly every year, was organized on 6th November, 2021 with a Zoom Seminar. At the seminar, relevant external subject-specific experts gave lectures, BOD members from AYA Bank, members of Senior Management, Compliance Officers and Compliance Members from the head office and branches attended.&lt;/p&gt;\r\n&lt;p&gt;Firstly, Daw Khin Saw Oo, Executive Chairman of AYA Bank, Chairman of Myanmar Banks Association and Chairman of the Association of Banks of ASEAN countries, delivered an opening speech and discussed the AML/CFT Framework. Next, Daw Yee Mar Myint, Director of the Central Bank of Myanmar discussed on &quot;AML/CFT Preventive Measure for Banks&quot;, U Zaw Moe, Director of the Central Bank of Myanmar discussed on &quot;AML/CFT Awareness Training Course for Banks&quot;, U Myint Soe, Deputy Chief of the Financial Intelligence Unit (FIU) discussed &quot;FIU Role and Functions, Current ICRG process &amp;amp; Risk&quot; and U Thurin Aung, Deputy Director of the Bureau of Special Investigation (BSI) discussed on &quot;AML/CFT &amp;amp; Countering the Financing of Proliferation&quot; respectively.&lt;/p&gt;', 2, 'blog_images/(3) Implementation of AML-CFT by AYA Bank (30 Sept 2022) (3.1).png', 'Implementation_of_Anti-Money_Laundering_Combating_the_Financing_of_Terrorism_AML_CFT_by_AYA_Bank', '2022-09-30T16:02', '2022', 1, 1, '2023-07-07 22:12:02', '2023-07-07 23:39:17', 0),
(26, 'AYA Bank\'s 4th Board of Directors\' Meeting for FY 2020-2021', 4, '&lt;p&gt;AYA Bank&#039;s 4th Board of Directors&#039; Meeting for FY2020-2021 was held today on 14th of May 2021. At the meeting, AYA Bank&#039;s Founder and Chairman U Zaw Zaw gave an opening remark by congratulating Daw Khin Saw Oo, Executive Chairman of AYA Bank on her being appointed as Chairman of the Myanmar Banks Association during it&#039;s recent Annual General Meeting, on behalf of AYA Bank. Other respective members of the Board discussed and give recommendations according to the agenda and the meeting adjourned at noon.&lt;/p&gt;', 2, 'blog_images/(4) AYA Bank 4th BOD Meeting for FY 2020-2021 (14 May 2021) (4.4).jpg', 'AYA_Bank_4th_Board_of_Directors_Meeting_for_FY_2020_2021', '2021-05-14T16:19', '2021', 1, 1, '2023-07-07 22:20:36', '2023-07-08 00:08:56', 0),
(28, 'Announcement for AYA Bankâ€™s Payroll Service Customers', 6, '<p>Is your company currently partnered with AYA Bank for payroll services?&nbsp;</p>\r\n<p style=\"padding-left: 40px;\">AYA Bank has an exciting announcement for our payroll service customers - an exclusive credit card offer of a 100% annual fee waiver for your employees, valid for up to five years.&nbsp;</p>\r\n<p style=\"padding-left: 40px;\">This employee benefit not only empowers your team with financial flexibility but also alleviates the burden of typical annual fees. With a choice of MPU, JCB, and Visa, there is an option for everyone, all with up to a 100% annual fee waiver.</p>\r\n<p>&nbsp;</p>\r\n<p>Are you interested in taking advantage of this outstanding offer?</p>\r\n<p style=\"padding-left: 40px;\">If your company is considering payroll services for your employees, you\'re warmly invited to visit any AYA Bank branch. Take your banking experience to new heights with AYA Bank.</p>', 1, 'blog_images/Announcement-for-AYA-Bank-Payroll-Service-Customers.webp', 'Announcement_for_AYA_Bankâ€™s_Payroll_Service_Customers', '2023-07-10T16:13', '2023', 1, 1, '2023-07-17 22:14:15', '2023-07-17 22:14:15', 0),
(29, 'U Zaw Zaw Drives Social Responsibility through Football in Myanmar', 9, '<p>U Zaw Zaw, Founder and Chairman of AYA Bank PCL, who also serves as the Asian Football Confederation (AFC) Senior Vice President, assists the larger community through a variety of purposeful humanitarian programmes. AFC highlights his philanthropic endeavours as the perfect examples of courage and kindness in the face of sheer adversity, leveraging the power of the game for the greater good of humankind.</p>\r\n<p>Most recently, while the whole world grappled with the COVID-19 global pandemic, the Myanmar Football Federation (MFF), under U Zaw Zaw&rsquo;s guidance, stepped up to support the people through a range of initiatives.</p>\r\n<p>U Zaw Zaw, who also chairs the Ayeyarwady Foundation, donated generously to help provide quarantine facilities, transportation services, food supplies, and health insurance to volunteers and caregivers, while also offering material help to local hospitals as they strived to meet their daily needs.</p>', 1, 'blog_images/U-Zaw-Zaw-Drives-Social-Responsibility-through-Football-in-Myanmar.webp', 'U_Zaw_Zaw_Drives_Social_Responsibility_through_Football_in_Myanmar', '2023-03-13T16:37', '2023', 1, 1, '2023-07-17 22:38:09', '2023-07-17 22:38:09', 0),
(30, 'Statement by the Myanmar Banks Association (MBA) regarding Development and Implementation of Anti-Money Laundering/Combating the Financing of Terrorism (AML/CFT)', 4, '&lt;p&gt;The Myanmar Banks Association issued a statement on 13 th October, 2022 regarding the implementation of AML/CFT by member banks and distributed to the member banks. In this statement, MBA announced the formation of the sub-committee on (AML/CFT); participating in the implementation of the national level strategic area to combat money laundering and terrorism financing; conducting (AML/CFT) knowledge sharing sessions; awareness raising regarding the financing of proliferation and the cooperation of member banks, as dedicated by the efforts of MBA.&lt;/p&gt;\r\n&lt;p&gt;The full statement can be read in both English and Burmese languages.&lt;/p&gt;', 4, 'blog_images/Statement_by_the_Myanmar_Banks_Association_MBA_regarding_Development_and_Implementation_of_Anti_Money_Laundering_Combating_the_Financing_of_Terrorism_AML_CFT.webp', 'Statement_by_the_Myanmar_Banks_Association_regarding_Development_and_Implementation_of_Anti_Money_Laundering_Combating_the_Financing_of_Terrorism_AML_CFT', '2022-10-13T17:25', '2022', 3, 1, '2023-07-17 23:43:09', '2023-07-21 15:33:25', 0),
(31, 'Celebration of International Womenâ€™s Day 2023 at AYA Bank Office', 9, '<p>In commemoration of International Women&rsquo;s Day, we celebrate the culture we have built with the women at AYA. In keeping with this year&rsquo;s theme &ldquo;Embrace Equity&rdquo;, we expressed our appreciation to women at office with the gift of flowers on 8th March, 2023.<br>Equity and flexibility are not just words for us. We have managed to truly embed them in our culture. Special appreciation goes to all inspirational women who help shape our organization.</p>', 2, 'blog_images/Thumbnail photo.webp', 'Celebration_of_International_Women_Day_2023_at_AYA_Bank_Office', '2023-03-08T10:19', '2023', 3, 3, '2023-07-20 16:22:17', '2023-07-20 16:22:17', 0);
INSERT INTO `blogs` (`id`, `blog_title`, `blog_category`, `blog_desc`, `media_type`, `featured_image`, `permalink`, `publish_date`, `publish_year`, `created_by`, `updated_by`, `created_at`, `updated_at`, `status`) VALUES
(33, 'AYA Bank Expands Benefit for Staff', 9, '<p>While maintaining priority of products and services which are beneficial and convenient for our customers, AYA Bank remains vigilant and focused on supporting our internal customers, &ldquo;Our employees&rdquo;.</p>\r\n<p>Since the prices of commodities have been rising at their fastest pace in recent months, the pressure of the cost-of-living crisis and resulting financial stress is a physical and emotional impact on our employees. The Senior Management of the Bank have decided to provide &lsquo;Cost of Living Support&rsquo; to help our employees cope with unexpected hardships that place undue financial stress on them and their families.</p>\r\n<p>Due to this kind of initiative, it is heartwarming to see our employees who will have some peace of mind on their cost-of-living burden and improved well-being. We are proud to give something back to our AYA family members.</p>\r\n<p>&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: center; line-height: 150%;\" align=\"center\"><strong><span style=\"font-size: 12.0pt; line-height: 150%; font-family: Sora; mso-fareast-font-family: \'Times New Roman\'; color: #2e2e2e;\">Words from Staff about &lsquo;Cost of Living Support&rsquo;</span></strong></p>\r\n<div class=\"row\">\r\n<div class=\"col-md-3\"><img class=\"img-fluid\" src=\"data:image/webp;base64,\"></div>\r\n<div class=\"col-md-9\">&ldquo;I&rsquo;ve been working at AYA Bank as a non-clerical staff for eight years. With &lsquo;Cost of Living Support&rsquo; provided by the Bank on top of salary, I can offset the rising price of essential living costs in the current climate. Besides, being a mother, I am quite relief for the expenses for my little girl. Most of all, I would like to express my gratitude to Founder and Chairman and Senior Management for their consideration for all staff. &rdquo; <br><br><span style=\"font-size: 10pt;\">Ma Chit Chit Zaw </span><br><span style=\"font-size: 10pt;\">Non-Clerical Staff</span></div>\r\n</div>\r\n<p><br><br></p>\r\n<div class=\"row\">\r\n<div class=\"col-md-9\">&ldquo;I am a security staff at AYA Bank. I am very glad to receive &lsquo;Cost of Living Support&rsquo; unexpectedly. Without question, the Bank&rsquo;s offering is invaluable for us since it helps alleviate the impact of the rising cost of living and I can support my parents more. This monetary gain is very much admired and my sincere thanks to Founder and Chairman and Senior Management for offering kind support in this difficult time.&rdquo; <br><br><span style=\"font-size: 10pt;\">Mg Zwe Lin Khant </span><br><span style=\"font-size: 10pt;\">Security Staff</span></div>\r\n<div class=\"col-md-3\"><img class=\"img-fluid\" src=\"data:image/webp;base64,\"></div>\r\n</div>', 0, 'blog_images/Image.webp', 'AYA_Bank_Expands_Benefit_for_Staff', '2022-10-28T11:17', '2022', 3, 3, '2023-07-20 17:18:16', '2023-07-25 00:19:35', 0);
