(34, 'Second COVID-19 Booster Vaccination Campaign for Staff to Maintain Long-Term Immunity', 9, '&lt;p&gt;On 24th September 2022, AYA Bank rolled out COVID-19 booster vaccination campaign for all staff in Yangon to help our people maintain strong protection from coronavirus disease. The vaccination arrangements were conducted at our head offices, ROWE office in Kyauktadar Township and River View office in Ahlone Township.&lt;/p&gt;\r\n&lt;p&gt;As part of the steps we have taken to decrease risk of coronavirus infection, we offered booster shot to all staff who were fully vaccinated for more than six months. AYA Bank further arranged booster shot in the following week for staff who missed the day to ensure the full coverage of our vaccination campaign. The campaign has been organized with the support of SML Medical and Diagnostics Center and more than 1700 staff received their booster dose.&lt;/p&gt;\r\n&lt;p&gt;Since the beginning of the COVID-19 pandemic, AYA Bank follows the guidelines of Ministry of Health and place preventive measures at workplace for both offices and branches. Maintaining a safe and healthy working environment for all our staff and customers is our top priority. Vaccination campaign is a critical step in the fight to COVID-19 and our heartfelt thanks to everyone working together to make this happen.&lt;/p&gt;', 2, 'blog_images/IMG_4462.webp', 'Second_COVID19_Booster_Vaccination_Campaign_for_Staff_to_Maintain_Long_Term_Immunity', '2022-09-24T14:15', '2022', 3, 3, '2023-07-20 20:17:41', '2023-07-24 17:13:46', 0),
(35, 'Ayeyarwady Foundation Annual Report for 2020', 9, '&lt;p&gt;Ayeyarwady Foundation, set up in 2010 as a Non-Profit Organization (NPO), has been focused on the areas of greatest need, on the ways in which we can do the most good. See below to find out more on activities of Ayeyarwady Foundation in 2020.&lt;/p&gt;', 1, 'blog_images/Cover Page.webp', 'Ayeyarwady_Foundation_Annual_Report_for_2020', '2021-01-15T14:24', '2021', 3, 1, '2023-07-20 20:27:46', '2023-07-20 20:31:38', 0),
(36, 'Ayeyarwady Foundation to build and donate the Covid-19 Test and Laboratory Center at Taikkyi', 9, '&lt;p&gt;Under the management of the Yangon Region Government, Ayeyarwady Foundation is building and donating the Covid-19 test center (Taikkyi), which is located at (43/6) miles on the Yangon-Pyay Road. This center is to test truck drivers for Covid-19 infection and the cost of test center will be contributed by Max Highway Co., Ltd. Upon completion of the construction works on 20 th October, 2020, the test center will be handed over to the Yangon Region Government.&lt;/p&gt;', 2, 'blog_images/CovicTetCenter-1.webp', 'Ayeyarwady_Foundation_to_build_and_donate_the_Covid19_Test_and_Laboratory_Center_at_Taikkyi', '2020-10-19T14:52', '2020', 3, 3, '2023-07-20 20:58:05', '2023-07-20 20:59:56', 0),
(37, 'Joint Contribution for Ayeyarwady Center by AYA Bank, AYA SOMPO Insurance and Max Myanmar Group', 9, '<p>AYA Bank, AYA SOMPO Insurance and Max Myanmar Group have jointly contributed &lsquo;One Billion Kyat&rsquo; (MMK 1,000,000,000) for buildings, infrastructures, medicines, supplies and other necessities for Ayeyarwady Center, which is mainly supported and managed by Ayeyarwady Foundation for receiving and giving treatments to Covid-19 patients.</p>', 2, 'blog_images/Covid_D_1.webp', 'Joint_Contribution_for_Ayeyarwady_Center_by_AYA_Bank_AYA_SOMPO_Insurance_and_Max_Myanmar_Group', '2020-09-19T15:23', '2020', 3, 3, '2023-07-20 21:23:20', '2023-07-20 21:23:20', 0),
(38, 'A Global Environmental Information Display as an initiative of the United Nations Environment Program under Title \"Towards a Solution to Eliminate Plastic\"', 9, '&lt;p&gt;A &amp;lsquo;Global Environmental Information Display&amp;rsquo; photo exhibition was taking place at Novotel Yangon Max Hotel, Yangon, from 12-9 December as a project of the United Nations Environment Program (UNEP) under the title &quot;Towards a Solution to Eliminate Plastic&quot; with the objective of promoting public awareness of the problems caused by waste, which is one of the environmental issues today.&lt;/p&gt;\r\n&lt;p&gt;The opening ceremony of the Global Environmental Information Display, held on 9th December 9:00 am at Novotel Yangon Max Hotel, 4th floor, was attended by officials from J-UNEP, SRIREP, Executives from Max Myanmar Group and AYA Bank and other interested parties.&lt;/p&gt;\r\n&lt;p&gt;The photo exhibition, display for 4 days will present information and photos on environmental changes, is open to public. It was organized by Japan Association for United Nation Environmental Program (J-UNEP), Public Interest Incorporated Foundation Associates of the Earth (AOE), and Research Institute for Humanity and Nature (RIHN) and sponsored by Max Myanmar Group and AYA Bank.&lt;/p&gt;', 2, 'blog_images/G_4.webp', 'A_Global_Environmental_Information_Display_as_an_initiative_of_the_United_Nations_Environment_Program_under_Title_Towards_a_Solution_to_Eliminate_Plastic', '2019-12-09T15:40', '2019', 3, 3, '2023-07-20 21:43:05', '2023-07-20 21:45:27', 0),
(39, 'Blood Donation Drive to Commemorate 9th Anniversary of AYA Bank', 9, '&lt;p&gt;Charity is not about wealth. . .&lt;br&gt;We have things that we can donate that are more valuable than money. . .&lt;br&gt;The blood flowing through our body is invaluable as it can save the life of a person in need.&lt;/p&gt;\r\n&lt;p&gt;Blood donation is a noble donation and we can get many benefits, such as&amp;nbsp;&lt;br&gt;1. Reducing the incidence of cancer;&lt;br&gt;2. Supporting for weight loss;&lt;br&gt;3. Replenishment of blood;&lt;br&gt;4. Reducing cholesterol;&lt;br&gt;5. Boosting red blood cell production and&lt;br&gt;6. Mentally rejuvenated.&lt;/p&gt;\r\n&lt;p&gt;This year&#039;s blood donation program was held on 10th August, 2019, to commemorate the 9th anniversary of the establishment of AYA Bank. A total 271 employees of the Bank participated in the noble blood donation were provided with foodstuff necessary regain energy. In support of this program, 100 Plus Myanmar also donated drinks.&lt;/p&gt;', 1, 'blog_images/new-4.1.webp', 'Blood_Donation_Drive_to_Commemorate_9th_Anniversary_of_AYA_Bank', '2019-08-10T16:00', '2019', 3, 3, '2023-07-20 22:01:54', '2023-07-20 22:03:45', 0),
(40, 'The 8th AYA Talk', 9, '<p>The &lsquo;8th AYA Talk&rsquo; for AYA Bank employees was held on 8th December at 9:00 a.m., Rowe Head Office, &nbsp;Kyauktada Township, Yangon, and U Chit Ko (CEO and Founder of Success Life Institution) gave a lecture on the topic of &lsquo;Make Your New One (Attain Your Success Life)&rsquo;.&nbsp;</p>\r\n<p>The speaker mainly discussed to foster equity and fairness among colleagues in the workplace, to improve good relationship in various social and economic environments along with work-life balance, to reduce physical and mental stress and to develop the inspirational leaders who can provide the best leadership and motivation. The 167 employees, who attended the event, has participated in discussions and fun programs, and the event was ended successfully at 1:00 p.m.</p>', 2, 'blog_images/8th_AYA_Talk_image_3.webp', 'The_8th_AYA_Talk', '2018-12-08T16:05', '2018', 3, 3, '2023-07-20 22:17:23', '2023-07-20 22:17:23', 0),
(41, 'AYA Environmental Care Activity', 9, '<p>AYA Environmental Care Activity as a part of its CSR initiatives by AYA Bank in Bago Township On the early morning of 14th June 2018, AYA Environment Day, AYA team led by its Corporate Affairs Department left for Bago Township to plant trees in order to maintain the green environment within the region in coordination with Wai Lu Won Monastery which is carrying out a green environment philanthropic project. On behalf of AYA Bank, firstly, AYA team donated cash to Venerable Sayartaw Dr Ashin Pyin Nyaw Bar Tha, the principal of Wai Lu Won monastery as well as the head of Pan Pyo Latt Philanthropic School in Kyout Tan San Pya Village, Bago Township. June born staff of the bank took part in the cash donations as well.</p>\r\n<p>Secondly, AYA team offered both breakfast and lunch to the monks at the monastery and also donated breakfast and lunch to 400 students who are studying in the monastery. Afterwards, AYA team gave away corporate stationaries to the children of Pan Pyo Latt Philanthropic School as well. Finally, AYA team enthusiastically planted 300 young trees of Malaysia Padauk in Kyout Tan San Pya Village, Bago Region. In the evening, AYA team headed back to Yangon and on their way back, the students from Pan Pyo Latt Philanthropic School gave beautiful flowers to all team members from AYA and cheerfully waived goodbye.</p>', 2, 'blog_images/Photo_1.webp', 'AYA_Environmental_Care_Activity', '2018-06-14T16:24', '2018', 3, 3, '2023-07-20 22:25:57', '2023-08-02 19:32:32', 0),
(42, 'Fraud Awareness', 6, '<p style=\"line-height: 1.4; text-align: left;\"><strong>Don&rsquo;t fall victim! </strong></p>\r\n<p style=\"line-height: 1.4; text-align: left;\"><strong>We believe that fraud prevention is everyone&rsquo;s responsibility. </strong></p>\r\n<p style=\"line-height: 1.4; text-align: left;\"><strong>The Bank is not liable for your loss caused by social media and online frauds.</strong></p>\r\n<p style=\"line-height: 1.4; text-align: left;\"><!-- [if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&uuml;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><!--[endif]-->Winning lottery;</p>\r\n<p style=\"line-height: 1.4; text-align: left;\"><!-- [if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&uuml;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><!--[endif]-->Sending parcels or money from abroad;</p>\r\n<p style=\"line-height: 1.4; text-align: left;\"><!-- [if !supportLists]--><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings;\"><span style=\"mso-list: Ignore;\">&uuml;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><!--[endif]-->Sweepstake or prize draw</p>\r\n<p style=\"text-align: left;\">are the most common reasons fraudsters contact you from social media (Facebook) and asked you to send money through banking, so that they can proceed for the payment of your winnings.<br>Hence, banking customers should process with special care to ensure that there are no financial frauds in money transfer for the above cases and if you are in doubt, please inform the person in charge of the branch and get advice.</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><strong>Warning!</strong></p>\r\n<p style=\"text-align: left;\">You may receive following communications from fake Facebook Page and Messenger for</p>\r\n<p style=\"text-align: left;\">&bull; Being forced to transfer money;<br>&bull; Asking for password information;<br>&bull; Requesting ATM card front / back photo</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: #e03e2d;\"><span style=\"mso-list: Ignore;\">&Oslash;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><!--[endif]--><span style=\"color: #e03e2d;\">Do not give your OTP code to anyone</span></p>\r\n<p><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: #e03e2d;\"><span style=\"mso-list: Ignore;\">&Oslash;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><!--[endif]--><span style=\"color: #e03e2d;\">Do not give your ATM PIN to anyone</span></p>\r\n<p><span style=\"font-family: Wingdings; mso-fareast-font-family: Wingdings; mso-bidi-font-family: Wingdings; color: #e03e2d;\"><span style=\"mso-list: Ignore;\">&Oslash;<span style=\"font: 7.0pt \'Times New Roman\';\">&nbsp; </span></span></span><!--[endif]--><span style=\"color: #e03e2d;\">Do not give your 16-digit card number to anyone</span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>', 4, 'blog_images/dont.webp', 'Fraud_Awareness', '2022-01-07T16:47', '2022', 3, 3, '2023-07-20 22:52:58', '2023-07-31 23:48:26', 0),
(43, 'The Core Banking System Upgrade', 6, '&lt;p&gt;The culmination of its commitment to continuous improvement and expansion of its depth and breadth of service to its cherished customers, by providing them with progressively more efficient and intuitive platforms, through the adoption of new technologies, AYA Bank will be upgrading to its new Core Banking System on 20 July 2021.&lt;/p&gt;\r\n&lt;p&gt;In the interest of updating its valued users prior to launch and ensuring a seamless transition between systems, key points pertaining to major changes are presented below:&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;New Account Numbers&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;As the Core Banking System will feature Bank Account Numbers with 11 digits, instead of the current 16, customers will be able to obtain their new Account Number via online &lt;span style=&quot;text-decoration: underline; color: rgb(165, 0, 11);&quot;&gt;https://accounts.ayabank.com&lt;/span&gt; or branch, starting from 11 Jan 2021. Customer can type Name, NRC No., Account Number (16 digit), Phone Number and Home Branch Name in &lt;span style=&quot;text-decoration: underline; color: rgb(165, 0, 11);&quot;&gt;https://accounts.ayabank.com&lt;/span&gt;, then Bank will send back New Account Number to your typed Phone Number via SMS. Besides, customers using the AYA Mobile Banking application will be able to see their new account numbers (applicable for accounts linked to Internet/ Mobile banking) that the application will begin displaying on its Home Page starting the 1st day of new system (20 July 2021). Loan and Hire Purchase (HP) account numbers will be available at all AYA Bank branches upon customer inquiry, prior to and following the Core Banking update.&lt;/p&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;The Passbook, Cheque and Card&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;The bank is happy to announce that, despite the new account numbers, customers are not required to make any changes to their Passbook, Cheque or Card; these products retain their features and can be used just as before.&lt;/p&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;Mobile Banking, Internet Banking and ATM&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;No changes are required to be made for individual Mobile Banking, Internet Banking and ATM Card; customers will be able to sign in using their current Username and Password and continue using the products normally.&lt;br&gt;With the new system cutover, once the new system is in place, customers will be required to re-enter their schedule payments/ Fast Pay/ etc. in their platforms.&lt;/p&gt;\r\n&lt;p&gt;A consequence of the breadth of its upgrade, the system will only display, on Mobile Banking and Internet Banking both, new customer transactions that occur after the 20th of July, 2021. Therefore, it is advised that, should customers wish to view it for periods preceding the schedule Core Banking update, they preemptively download and save their transaction histories now by utilizing the most convenient means, be it exporting to Excel, printing, or screen capturing. However, though the &amp;lsquo;transaction details&amp;rsquo; tool under the &amp;lsquo;information Inquiry&amp;rsquo; function on the iBanking site is affected by the aforementioned refresh, the alternative procedure for transaction history viewing, the &amp;lsquo;iBanking transaction history&amp;rsquo; tool under the &amp;lsquo;Payment&amp;rsquo; function, is not. Thus, customers can follow it to view their transaction history (limited to 3 months) for periods prior to the 20th of July 2021. Alternatively, customers will be, as they currently are, obtain their transaction history by requesting for their Bank Statement at the nearest AYA Bank branch.&lt;/p&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;Account Transfers&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;As all customers will receive an update to their account numbers, those wishing to make transfers are respectfully reminded to be sure to obtain the recipient&amp;rsquo;s new account number from them directly.&lt;/p&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;Corporate Internet Banking &lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;The Corporate Internet Banking service will be receiving a wide array of upgrades- improvements upon, and introductions of, features that enable AYA to serve its valued customers better. As such, corporate customers will require new Login information (URL, User ID, Company ID, Password), the details of which can be acquired from one&amp;rsquo;s Relationship Manager, prior to and following the system overhaul.&lt;/p&gt;\r\n&lt;p&gt;&lt;br&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;On Account Security&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;At no point during the Core Banking system cutover, or at any time, will AYA Bank extend unsolicited inquiries to customers seeking their log-in information e.g. Username, Password, NRC, or any other information related to log-in, nor will make any charges pertaining to the system update; such solicitations are to be considered fraudulent. As such, to ensure account integrity, customers are respectfully urged to keep their key personal information confidential.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;span style=&quot;color: rgb(165, 0, 11);&quot;&gt;&lt;strong&gt;Inquiries&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;All questions can be directed to the AYA Bank Contact Center, available at 01-2317777.&lt;/p&gt;', 4, 'blog_images/announcement_detail_banner.webp', 'The_Core_Banking_System_Upgrade', '2021-07-20T17:16', '2021', 3, 3, '2023-07-20 23:24:59', '2023-07-20 23:33:32', 0),
(45, 'Second Batch of Certified Branch Managers Program', 4, '&lt;p&gt;AYA Bank has proudly wrapped up the second batch of &amp;lsquo;Certified Branch Managers Program&amp;rsquo; for our 2ICs, who are the next person to lead the branch, with a special welcome and inspirational talk by our Founding Chairman, U Zaw. Esteemed guest speakers, Professor Dr. Aung Tun Thet and Daw Aye Aye Win also shared invaluable insights on key banking topics. As per the program agenda, our Executive Team led enlightening discussions, arming branch managers with effective strategies. The program aligned with our dedication to excellence, ongoing business evolution, and tackling market challenges.&lt;/p&gt;\r\n&lt;p&gt;Organized by People, Learning and Development teams, the comprehensive certification program evaluated managers across various criteria, highlighting our commitment to enhancing their expertise. Our People Division relentlessly fosters growth and achievement, underscoring our dedication to professional development. Through the blended curriculum, this program has provided a space for 2ICs to better understand themselves and their role as a manager. The program ended successfully with interactive learning and discussions and a plan for taking the key practices back into the organization and people.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', 2, 'blog_images/1.webp', 'Second_Batch_of_Certified_Branch_Managers_Program', '2023-07-18T15:31', '2023', 3, 3, '2023-07-21 21:33:05', '2023-07-21 21:34:12', 0),
