(61, 'Mask Distribution to Public by AYA Bank', 9, '&lt;p&gt;As part of our Corporate Social Responsibility (CSR) activities, &amp;lsquo;Wear a Mask Campaign&amp;rsquo; was organized on 28th January 2022 at AYA Bank&amp;rsquo;s Head Office in Kyauktadar Township, and near Sule Pagoda in support of COVID-19 protection measures, especially when a new subtype of the Omicron Coronavirus variant is spreading. With the objective of encouraging people to keep practice of wearing mask outdoors, AYA Bank staff distributed face masks packs to the public, who passed by Sule Pagoda and visited AYA Bank. AYA Bank is actively participating not only in the development of health sector in the country but also the social welfare activities by organizing such awareness campaigns.&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;', 2, 'blog_images/1 Cover Photo - IMG_4205.webp', 'Mask_Distribution_to_Public_by_AYA_Bank', '2022-01-28T17:17', '2022', 3, 3, '2023-07-21 23:19:53', '2023-07-21 23:25:48', 0),
(62, 'Statement by Ayeyarwady Bank on Changing to Public Company Limited', 10, NULL, 4, 'blog_images/Statement-of-AYA-Bank-Changing-To-Public.webp', 'Statement_by_Ayeyarwady_Bank_on_Changing_to_Public_Company_Limited', '2023-03-10T17:49', '2023', 3, 3, '2023-07-21 23:51:36', '2023-07-21 23:51:36', 0),
(63, 'Ayeyarwady Foundation contributes 10 million MMK and other necessary supplies to South Okkalapa Hospital for Covid-19 Prevention and Treatment', 9, '&lt;p class=&quot;MsoNormal&quot;&gt;On behalf of Ayeyarwady Foundation, Ms. Eaint Hmu Zaw and Mr. Ye Mann Zaw have contributed 10 million MMK and other necessary supplies to Dr. Win Maw Oo, Head of South Okkalapa Hospital for Covid-19 Prevention and Treatment. Ayeyarwady Foundation has constantly contributing all its resources for the people&amp;rsquo;s safety and public health during Covid-19 pandemic in Myanmar.&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&amp;nbsp;&lt;/p&gt;', 2, 'blog_images/S-1.webp', 'Contribution_of_10_million_Kyat_to_South_Okkalapa_Hospital', '2020-10-14T11:02', '2020', 3, 3, '2023-07-23 17:04:36', '2023-07-23 17:14:26', 0),
(64, 'AYA Bank donated additional â€˜One Billion Kyatâ€™ for the expenses of the ICU/HDU Ayeyarwady Center', 9, '<p>AYA Bank donated additional supplies for a 75-bedded ICU/HDU Unit at the Ayeyarwady Center.</p>\r\n<p>For ICU/HDU, the Ministry of Health and Sports is providing necessary equipment and to fulfill the additional requirement of medicines and equipment as oxygen machines from abroad, AYA Bank has donated One Billion Kyat (MMK 1,000,000,000) and Max Myanmar Company Group has donated Five Hundred Million Kyat (MMK 500,000,000), respectively, to Ayeyarwady Foundation.</p>\r\n<p>The new ICU/HDU is operated and run by the Special Medical Team of (150) personnel comprising of specialists, doctors, nurses, members of Ayeyarwady Foundation and volunteers who all are working closely together to care for the emergency patients. For the next phase, the new 50-bed extension building of Ayeyarwady Center will be opened soon and will be able to accommodate up to 125 ICU/HDU patients.</p>', 2, 'blog_images/Additional_Donation_1.webp', 'AYA_Bank_donated_additional_One_Billion_Kyat_for_the_expenses_of_the_ICU_HDU_Ayeyarwady_Center', '2020-10-07T11:39', '2020', 3, 3, '2023-07-23 17:40:51', '2023-07-23 17:40:51', 0),
(65, 'The Opening of 400-bedded Covid-19 Treatment Center', 9, '<p style=\"text-align: left;\">The Ayeyarwady Center, 400-bedded Covid-19 Treatment Center in Thuwanna, built within (7) days by the Ayeyarwady Foundation with the guidance of the Ministry of Health and Sports, has started receiving and giving treatments to Covid-19 positive patients on the evening of 19th September, 2020.</p>\r\n<p style=\"text-align: left;\">The Ayeyarwady Center contained treatment units to accommodate (400) patients at the same time, Intensive Care Unit, Duty Room (Control Center), one store building for medical equipment and supplies, bathrooms and restrooms, Examination Rooms, Protective Chambers to take Swab Test, lounges for health workers and volunteers, washing machine, PPE changing rooms and bathrooms with lockers and disinfection systems, Dormitories for about (150) health workers and volunteers, CCTV monitoring system, fire alarm system and fire extinguisher, PA system, QR Code Registration System, facilities for video communications between doctors and patients, large generators for providing sufficient electricity, proper waste disposal system and catering facilities.</p>\r\n<p style=\"text-align: left;\">The center arranged private rooms with bedding, hospital lockers, tables, chairs, power outlets for convenient use of electronic devices, litter box, plastic box containing 21 kinds of accessories for each individual, drinking water, easily available hot water and cold water. Each dormitory contains small storage cabinets to provide additional daily accessories as needed.</p>\r\n<p style=\"text-align: left;\">In addition, the management office of the Ayeyarwady Center has been opened in the Myanmar Football Federation building, so that the center\'s treatment activities can run smoothly, enabling to fulfill requirements on time, receiving and distributing cash and in kind donations.</p>\r\n<p style=\"text-align: left;\">The Ministry of Health and Sports provided the necessary hospital equipment for the Ayeyarwady Center, and additional requirement of hospital equipment, medicines and other supplies are organized by the Ayeyarwady Foundation with the support of well-wishers who donated cash and in kind.</p>', 2, 'blog_images/AYA-Center-New-1.webp', 'The_Opening_of_400_bedded_Covid19_Treatment_Center', '2020-09-19T11:55', '2020', 3, 3, '2023-07-23 17:57:00', '2023-07-23 17:57:00', 0),
(66, 'Ayeyarwady Foundation provides machinery for the conservation of Inle Lake for three years', 9, '&lt;p&gt;In an effort to conserve the steady flow free from algae, garbage wastes, unwanted soil residues from forming, Ayeyarwady Foundation have contributed for three consecutive years for the conservation of &amp;nbsp;Inle Lake, one of top icons for Myanmar tourism and Myanmar environmental image, placed in the Shan Hills of Myanmar.&lt;/p&gt;\r\n&lt;p&gt;The foundation had steadily supported a multipurpose amphibian dredger&amp;lrm; (HITACHI ZX210K-3 Amphibious Excavator) and a professional staff over three years to eliminate common emergence of aquatic weeds, such as water iris, bulrush, tule, cattail, and water-borne algae.&lt;/p&gt;\r\n&lt;p&gt;Along with the vision of conservation for Inle Lake, Ayeyarwady Foundation also supported to build connecting roads between thirty-four villages since 2016, which means supporting 800 million MMK for the costs of working process.&lt;/p&gt;', 2, 'blog_images/Innlay-1.webp', 'Inlay_Lake_Sustainability', '2020-06-10T12:08', '2020', 3, 3, '2023-07-23 18:09:38', '2023-07-23 18:17:08', 0),
(67, 'â€˜Sharing with Careâ€™ by AYA Bank - Provided Rice and Cooking Oil for Staff', 9, '<p>During the current covid-19 pandemic, AYA Bank has provided necessities such as rice bags and cooking oil to each member of 2,200 non-clerical staff from head office and branches through the &lsquo;Sharing with Care&rsquo; program.&nbsp;</p>\r\n<p>With a total of seventy-five million Kyats (MMK 75,000,000), which all senior officials contributed a proportional percentage of their income, the non-clerical staff will be able go through the pandemic comfortably with this kind of provision. &lsquo;Sharing with Care&rsquo; program extended heartfelt thanks to our Board of Directors, senior management members, heads of departments and divisions for their kind contribution and consideration.<br>Furthermore, during this week of April 2020, (15,000) rice bags worth four hundred million Kyats (MMK 400,000,000) was donated through the regional and state governments for use in the areas in need, all over Myanmar, due to COVID-19.</p>\r\n<p>In addition, AYA Bank has been taking further steps in combating Covid-19 such as establishing a health insurance fund for health workers and providing support for living and transportation, donation of necessary protective equipment for hospitals and provision for facility quarantine centers and refreshments for those returning from abroad.</p>', 2, 'blog_images/NCS-1.webp', 'Sharing_With_Care_for_Non_Clerical_Staff', '2020-04-08T12:20', '2020', 3, 3, '2023-07-23 18:23:13', '2023-07-23 18:23:13', 0),
(68, 'Cleaning Service, Hygiene and Workplace Ethic for the Housekeeping Staff of AYA', 9, '<p>In order to improve the professional skills of the housekeeping staff who are working at AYA Bank, Yangon Head Office, the Administrative Department, with support from Learning &amp; Development (L&amp;D) Department, has organized a \"Cleaning Service, Hygiene and Workplace Ethic for Housekeeping Staff\" course on 7th September from 8:30 am to 2:00 pm in the conference room at River View Head Office in Ahlone Township.</p>\r\n<p>In the first session of the training, from 8:30 AM to 10:30 AM, U Thant Zaw Soe (GM, Admin) and Daw Ei Ei Aung (Deputy Manager, L&amp;D) covered the topics of workplace ethics, customer service and personal hygiene in order to provide good service in business areas related to internal/external customers and to be able to take care of personal health and hygiene. After that, U Tin Aung Win, the Assistant Executive Housekeeper of Novotel Hotel, Yangon, gave theory and practical training on the \"Cleaning Service Training\" from 11:00 a.m. to 12:00 p.m. in order to enable 143 Housekeeping staff to become more proficient in cleaning operations.&nbsp;</p>\r\n<p>At the end of the first session of the training, lunch was served for all the employees, and in the second session, (35) housekeeping staff who are working at the headquarters and training centers were given practical training with cleaning equipment by U Tin Aung Win from 1:00 p.m. to 2:00 p.m.</p>\r\n<p>U Tin Aung Win and team were presented with souvenirs from AYA Bank. The training program was successfully completed at 2:00 p.m. after taking group photos.</p>', 2, 'blog_images/Cleaning-Image-1.webp', 'Cleaning_Service_Hygiene_and_Workplace_Ethic_for_the_Housekeeping_Staff_of_AYA', '2018-09-07T12:28', '2018', 3, 3, '2023-07-23 18:31:25', '2023-07-23 18:31:25', 0),
(69, 'Ayeyarwady Foundation funded 500 Million MMK worth of Health Insurance Benefit for Caregivers in Myanmar', 9, '<p>Ayeyarwady Foundation has donated the fund for Health Insurance worth 500 Million MMK for Caregivers in Myanmar, who are actively working relentlessly across the country to contain and fight against the COVID-19 spread. This funding was realized after the discussion between Dr. Myint Htwe, Union Minister for Health and Sports and U Zaw Zaw, Chairperson of the Ayeyarwady Foundation and AYA SOMPO Insurance Company Limited. This Health Insurance Benefit Fund is aimed at the front line health care workers working at the hospitals and various areas across the country respectively to feel safe for their health while caring for the patients during the crisis of COVID-19. Moreover, the Foundation has provided services at the AYA Bank&rsquo;s Training Centre for their accommodation, daily meals and transportation services ferrying the doctors and nurses from Waibargi Hospital, who are currently facing the difficulties of commuting and lodgings.</p>\r\n<p>&nbsp;</p>', 2, 'blog_images/AYA-Foundation-1.webp', 'Ayeyarwady_Foundation_funded_500_Million_MMK_worth_of_Health_Insurance_Benefit_for_Caregivers_in_Myanmar', '2020-04-02T14:13', '2020', 3, 3, '2023-07-23 20:14:02', '2023-07-23 20:14:02', 0),
(70, 'AYA Bank Participated in the â€˜World Cancer Dayâ€™ Community Walk Campaign', 9, '<p>AYA Bank actively participated in the community walk campaign organized by the Golden Rose Cancer Foundation under the guidance of the Ministry of Health and Sports and the Yangon Region Government, today to commemorate the World Cancer Day which falls on 4th February 2019.</p>\r\n<p>The campaign entitled \"I AM AND I WILL\", organized by International Cancer Control Organization for 2019-2021 commemorative years, was included in the program held today with cancer awareness talk program.</p>\r\n<p>At the &lsquo;World Cancer Day&rsquo; community walk campaign more than 1,700 people from various organizations, including government and non-governmental organizations. As a trusted partner, AYA Bank actively participated in such activities for the benefit of the people.</p>', 2, 'blog_images/World-Cancer-Day-image-1.webp', 'AYA_Bank_Participated_in_the_World_Cancer_Day_Community_Walk_Campaign', '2019-02-04T14:21', '2019', 3, 3, '2023-07-23 20:22:58', '2023-07-23 20:22:58', 0),
(71, 'A Road Safety Campaign for road Users being conducted', 9, '<p>Education program for drivers and passengers to comply with road safety rules such as driving at the specified speed on expressways and wearing seat belts was jointly organized by AYA Bank, AMI, AYA Trust, Max Myanmar and Max Highway on 7th July, 2019 at the Htauk Kyant Toll Gate from 7:30 AM to 9:00 AM.</p>\r\n<p>This program includes applying reflective stickers to vehicles passing through the toll gates as an alert to avoid traffic accidents, sharing road safety knowledge to passengers and distributing key chains as gifts.</p>\r\n<p>On 6th July 2019, road safety programs were also conducted at Mhawbi Toll Gate. The programs which benefit society will be extended in the future as well.</p>\r\n<p>&lsquo;Your life is important and invaluable both for yourself and your family.&rsquo;</p>\r\n<p>Since driving during the rainy season is very dangerous, drive with care to keep others and yourself safe.</p>\r\n<p>&nbsp;</p>', 2, 'blog_images/SC-1-July-7.webp', 'A_Road_Safety_Campaign_for_road_Users_being_conducted', '2019-07-07T14:24', '2019', 3, 3, '2023-07-23 20:26:51', '2023-07-23 20:26:51', 0),
(72, 'Contribution of (15,000) Rice Bags to COVID-19 Impacted Areas by Ayeyarwady Foundation', 9, '<p>As per direction from U Zaw Zaw, Founder Chairman of the Ayeyarwady Foundation, and board members, arrangements have been made to donate (15,000) bags of rice worth four hundred million Kyats (MMK 400,000,000) through the regional and states governments. Commencing from 6th April 2020, donation of (2,500) bags of rice to the Yangon Region Government, (2,500) to the Mandalay Region Government, (1,000) to the Sagaing Region Government, (1,000) to the Bago Region Government, (1,000) to the Kayah State Government, a total of (8,000) bags of rice have been donated. We will continue to donate (7,000) rice bags to the remaining regions and states in the coming days.</p>\r\n<p>The Ayeyarwady Foundation has been actively participating in combating COVID-19 outbreak in the country, providing health insurance, accommodation, and transportation support for health workers. In addition, we are providing necessary protective equipments for hospitals, quarantine center facilities and refreshments for people returning from abroad. The Foundation has spent more than eight hundred and thirty million Kyats (MMK 830,000,000) for COVID-19 support.</p>', 2, 'blog_images/C-19-Donation-1.webp', 'Contribution_of_15,000_Rice_Bags_to_COVID19_Impacted_Areas_by_Ayeyarwady_Foundation', '2020-04-06T14:30', '2020', 3, 3, '2023-07-23 20:32:06', '2023-07-23 20:32:06', 0),
(73, 'AYA Bank Organized Industrial Visit for Students', 4, '<p>We are pleased to share that in continuation of our endeavor to support the next generation, we welcomed a very promising undergraduate students from Myanmar Noble University College to AYA Bank&rsquo;s Riverview Head Office on July 27, 2023. The aim of the initiative is to help students learn about the latest technology trend, to give exposure about the practical aspects of banking industry and to understand opportunities available after school.</p>\r\n<p>During the visit, U Minn Wint Oo, Managing Director of Banking Operations and Retail Banking at AYA Bank, graciously shared his extensive knowledge of the industry and highlighted the corporate milestones achieved by the bank. He encouraged the students to make the most of this opportunity, allowing them to gain deeper insights into the workings of banking operations and the ongoing digital transformation within the industry. The visit was attended by a total of thirty-six students who had the opportunity to explore and tour the bank\'s premises.</p>\r\n<p>We firmly believe that this industrial visit served as a bridge between the theoretical knowledge imparted in the classroom and its practical application in the real-world industry setting. By exposing the students to the inner workings of a leading bank like AYA Bank, we hope to empower and inspire them to make informed career choices and pursue opportunities in the banking sector.</p>\r\n<p>At AYA Bank, we remain committed to fostering the growth and development of the younger generation, and we look forward to organizing more insightful initiatives in the future to empower students on their educational journey.</p>', 2, 'blog_images/Thumbnail.webp', 'AYA_Bank_Organized_Industrial_Visit_for_Students', '2023-07-28T10:12', '2023', 3, 3, '2023-07-31 16:13:34', '2023-08-04 22:03:26', 0),
(74, 'Tree Planting Commemorates World Environment Day', 9, '<p>In a world where flowers bloom and greens flourish, we embarked on a transformative journey to \"Plant a Tree, Save the Environment.\" To celebrate World Environment Day on June 5th, 2023, AYA Bank organized a tree-planting initiative at the Pan Pyo Latt Philanthropic School (Monastery) in Bago Township.</p>\r\n<p>Led by U Myint Zaw, Chief Executive Officer of AYA Bank, along with senior officials, 100 staff members actively participated in the campaign. Located just a short drive from Yangon city, this sanctuary embodies AYA Bank\'s commitment to environmental stewardship - AYA Bank Taking Action for a Greener Future.</p>\r\n<p>Year after year, AYA Bank spearheads tree planting projects as an integral part of our annual initiatives. As part of our esteemed Corporate Social Responsibility (CSR) program, we proudly showcase our commitment to environmental conservation, recognizing the significant efforts of the revered monastery in preserving the lush green environment. Through this campaign, the bank pledges to plant a minimum of 1,000 trees each year, demonstrating our commitment to environmental conservation along our green journey. These endeavors reflect our unwavering dedication to preserving our natural resources and leaving a lasting legacy for future generations.</p>\r\n<p>Spanning 100 acres, Pann Pyo Let Monastery stands as a remarkable testament to environmental stewardship. Within its grounds, a flourishing forest, captivating garden, and organic greens farm coexist in harmonious abundance. These vibrant landscapes exemplify sustainability and serve as a nurturing space for spiritual enlightenment and educational growth, as the monastery operates as a revered monastic school. Through the tree-planting campaign, we witnessed the monastery\'s unwavering dedication to environmental conservation.</p>\r\n<p>\"I am confident that this tree planting campaign will yield long-term benefits. I would like to take this opportunity to encourage everyone to plant trees within their surroundings, compounds, premises, and even consider indoor plants at their workspaces. AYA Bank is wholeheartedly committed to promoting a \'Green Environment\' as a holistic endeavor, not just an isolated activity,\" expressed U Myint Zaw, Chief Executive Officer of AYA Bank.</p>\r\n<p>Aligned with AYA Bank\'s commitment to sustainable development, this reforestation effort aims to safeguard the environment while fostering environmental consciousness among participants. Various perennial and shade-providing tree saplings, including Mahogany, Bamboo, Acacia, and Manjansha, were planted across designated areas, covering a total of one acre. The involvement of local communities adds an extra layer of significance as they will be responsible for monitoring and ensuring the long-term growth of the trees.</p>\r\n<p>As flowers bloom and greens flourish, we envision a world where nature\'s beauty thrives, leaving a lasting impact on our planet.&nbsp;</p>', 2, 'blog_images/Tree_Planting_Cover_2.webp', 'Tree_Planting_Commemorates_World_Environment_Day', '2023-06-02T10:07', '2023', 3, 3, '2023-08-07 16:11:40', '2023-08-07 22:33:19', 0),
(75, 'Donation of Computers at Pan Pyo Latt Philanthropic School to Bridge the Digital Gap', 9, '<div>On 3rd August, 2023, with the objective to encourage young people to concentrate on IT skills from their early days, AYA Bank donated thirty desktop computers to Pan Pyo Latt Philanthropic School (Monastery) in Bago Township. We are thrilled to conduct this vital initiative to support digital inclusion as part of our CSR activities.</div>\r\n<div>&nbsp;</div>\r\n<div>Recognising the need for computers at schools, AYA Bank grips an opportunity to repurpose the Bank&rsquo;s resources and make a meaningful difference. With dedicated effort and technology expertise of our IT Department, the computers became available to donate for those in need. The PCs are modern and equipped with Windows 11, making them a valuable asset to the community that will receive them. The donation comes at a critical time, as the school is currently experiencing a shortage of computers.</div>\r\n<div>&nbsp;</div>\r\n<div>The donation ceremony for thirty computers and cash one million Kyat (MMK 1,000,000) was held at Pan Pyo Latt, led by Daw Khin Saw Oo, Executive Chairman of AYA Bank and participated by representatives of the Bank.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;Digital literacy is a vital part of education these days. Information technologies change rapidly. On behalf of AYA Bank, it is hoped that these computer sets will be an asset to improve student skills and talent in educational technologies for both primary and high school levels at Pan Pyo Latt. &ldquo;, said Daw Khin Saw Oo, Executive Chairman of AYA Bank.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>&ldquo;At AYA Bank, we believe that digital inclusion lays the foundation for economic mobility and a more equitable future. Our contribution is a meaningful step toward closing the digital divide for students in the area.&rdquo;, said U Myint Zaw, Chief Executive Officer of AYA Bank.&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div>With technology becoming increasingly essential for education, communication, and economic development, the impact of these computers on the lives of the people they reach will be profound. Being a socially responsible company, AYA Bank believe in making a positive contribution to the community and looking forward to enhancing the impact on people&rsquo;s lives.</div>\r\n<div>&nbsp;</div>', 2, 'blog_images/Donation_of_Computers_at_Pan_Pyo_Latt_Cover_2.webp', 'Donation_of_Computers_at_Pan_Pyo_Latt_Philanthropic_School_to_Bridge_the_Digital_Gap', '2023-08-03T11:00', '2023', 3, 3, '2023-08-07 17:05:03', '2023-08-07 17:31:18', 0),
(76, 'Malware Alert', 6, '<p>Lately, there has been a concerning trend of malicious apps infiltrating users\' mobile phones through advertisements on popular Social Networks such as Facebook. These ads often promote seemingly legitimate services, but they contain hidden malware.</p>\r\n<p>If you happen to download and use these deceptive apps, external parties gain control over your phone, enabling them to steal sensitive information like your mobile pay password and OTP (One-Time Password). With this access, they can transfer your money without your knowledge and even borrow money from your social network connections.</p>\r\n<p>For your safety and security, it is crucial to avoid installing unreliable apps and exercise caution while using your mobile phone. Stay vigilant and protect your personal data from potential threats.</p>\r\n<p>&nbsp;</p>\r\n<p>á€œá€á€ºá€á€œá€±á€¬á€á€½á€„á€º Facebook á€€á€²á€·á€á€­á€¯á€· Social Network á€™á€»á€¬á€¸á á€€á€¼á€±á€¬á€ºá€„á€¼á€¬ á€™á€¾á€á€†á€„á€ºá€· á€™á€­á€™á€­áá€–á€¯á€”á€ºá€¸á€‘á€²á€á€­á€¯á€· apps á€á€½á€„á€ºá€¸á€á€­á€¯á€„á€ºá€¸á€…á€±á€•á€¼á€®á€¸ malware á€™á€»á€¬á€¸á€•á€«á€‘á€Šá€ºá€·á€á€½á€„á€ºá€¸á€”á€±á€á€¼á€„á€ºá€¸á€€á€­á€¯ á€€á€¼á€¬á€¸á€á€­á€›á€•á€«á€á€Šá€ºá‹ &nbsp;</p>\r\n<p>á€‘á€­á€¯ apps á€á€„á€ºá€›á€±á€¬á€€á€ºá€•á€¼á€®á€¸á€•á€«á€€ á€™á€­á€™á€­á á€–á€¯á€”á€ºá€¸á€¡á€¬á€¸á€á€„á€ºá€›á€±á€¬á€€á€ºá€‘á€­á€”á€ºá€¸á€á€»á€¯á€•á€ºá€•á€¼á€®á€¸ á€™á€­á€™á€­á á€˜á€á€ºá€¡á€€á€±á€¬á€„á€ºá€·áŠ á€™á€­á€¯á€˜á€­á€¯á€„á€ºá€¸ wallet password á€”á€¾á€„á€ºá€· OTP á€™á€»á€¬á€¸á€¡á€¬á€¸á€á€­á€¯á€¸á€šá€°á€•á€¼á€®á€¸ á€™á€­á€™á€­á€™á€á€­á€•á€² á€„á€½á€±á€œá€½á€¾á€²á€šá€°á€”á€­á€¯á€„á€ºá€•á€«á€á€Šá€ºá‹ á€‘á€­á€¯á€·á€¡á€•á€¼á€„á€º á€™á€­á€™á€­á social account á€™á€¾ á€™á€­á€á€ºá€†á€½á€±á€™á€»á€¬á€¸á€‘á€¶á€á€­á€¯á€· á€„á€½á€±á€á€»á€±á€¸á€™á€¾á€¯á€™á€»á€¬á€¸á€•á€¼á€¯á€œá€¯á€•á€ºá€”á€­á€¯á€„á€ºá€•á€«á€á€Šá€ºá‹&nbsp;</p>\r\n<p>á€á€­á€¯á€·á€•á€«á€á€–á€¼á€„á€ºá€· á€™á€­á€™á€­á á€–á€¯á€”á€ºá€¸á€¡á€¬á€¸ á€™á€­á€™á€­á€™á€á€­á€á€±á€¬áŠ á€…á€­á€á€ºá€™á€á€»á€›á€á€±á€¬ apps á€™á€»á€¬á€¸á€¡á€¬á€¸ á€‘á€Šá€ºá€·á€á€½á€„á€ºá€¸á€á€¼á€„á€ºá€¸á€™á€•á€¼á€¯á€›á€”á€º á€á€á€­á€•á€¼á€¯á€œá€¯á€•á€ºá€†á€±á€¬á€„á€ºá€€á€¼á€•á€«á€›á€”á€º á€¡á€€á€¼á€±á€¬á€„á€ºá€¸á€€á€¼á€¬á€¸á€¡á€•á€ºá€•á€«á€á€Šá€ºá‹</p>', 0, 'blog_images/malware_alert.webp', 'Malware_Alert', '2023-08-07T11:15', '2023', 3, 3, '2023-08-08 17:15:41', '2023-08-09 18:20:36', 0);
